import axios from "axios";
import { passwordResets } from "../urls";

export const postPasswordReset = (params) => {
  return axios.post(passwordResets, {
    email: params.email
  }).then(res => {
    console.log('passwordReset#create', res);
    return res.data;
  }).catch(error => {
    console.log('passwordReset#create', error)
  })
}
